/**
 * @param {string} s
 * @param {string[]} words
 * @return {number[]}
 */
var findSubstring = function (s, words) {
    words.sort();
    var ans = [];
    var tmp = []
    const dfs = (used) => {
        if (tmp.length == words.length) {
            ans.push(tmp.slice())
            return
        }

        for (var i = 0; i < words.length; i++) {
            if (i > 0 && words[i] == words[i - 1] && !used[i - 1]) continue
            if (!used[i]) {
                tmp.push(words[i])
                used[i] = true
                dfs(used)
                tmp.pop()
                used[i] = false
            }
        }
    }
    dfs([]);
    var arr = []
    const diff = (len, word) => {
        console.log(len, 'ccc', word)
        if (len.indexOf(word) != -1) {
            arr.push(len.indexOf(word) + s.length - len.length)
            diff(len.slice(len.indexOf(word) + 1), word)
        }
    }
    for (var i = 0; i < ans.length; i++) {
        diff(s, ans[i].join(''))
    }

    console.log(ans, arr)
};

var s = "", words = ["dhvf","sind","ffsl","yekr","zwzq","kpeo","cila","tfty","modg","ztjg","ybty","heqg","cpwo","gdcj","lnle","sefg","vimw","bxcb"];

console.log(findSubstring(s, words))